imagen = np.array(imagen)

def mover_todo(mat):
    lista = []
    for fila in mat:
        fila = list(fila)
        for col in range(len(fila) - 2, -1, -1):
            if fila[col] == 0 and fila[col + 1] == 1:
                fila[col], fila[col + 1] = 1, 0
        lista.append(fila)
    return np.array(lista)
if __name__ == "__main__":
    while True:
        with multiprocessing.Pool() as grupo:
            nueva = grupo.map(mover_todo, [imagen])[0]
        if np.array_equal(nueva, imagen):
            break
        imagen = nueva
        plt.imshow(imagen, cmap='gray', vmin=0, vmax=1)
        plt.axis('off')
        plt.pause(0.1)
        plt.clf()
    plt.imshow(imagen, cmap='gray', vmin=0, vmax=1)
    plt.title("Imagen Final")
    plt.axis('off')
    plt.show()